import React from "react";

import "./HomeBookingSection.css";

const HomeBookingSection = () => {
  return (
  <div className="main-booking container c-row">
    <h2>Your plan, your choice</h2>
    <p className="text extra-margin">Unlock your creative potential with Vibini Creates</p>
    <div className="container booking-option">
        <h3>Monthly subscription</h3>
        <h4>Rs. 6000 <br/><span>per month</span></h4>

    </div>
    <div className="container booking-option"></div>
    <div className="container booking-option"></div>
  </div>
  );
};

export default HomeBookingSection;
